//momi.cgm616.me/transcripts/ellen/":{"tf":1.0}},"df":1}}}},"x":{"docs":{},"df":0,"p":{"docs":{},"df":0,"l":{"docs":{},"df":0,"o":{"docs":{},"df":0,"r":{"docs":{"https://momi.cgm616.me/sections/":{"tf":1.0}},"df":1}}}}}},"g":{"docs":{},"df":0,"a":{"docs":{},"df":0,"b":{"docs":{},"df":0,"e":{"docs":{"https://momi.cgm616.me/transcripts/gabe/":{"tf":1.0}},"df":1}}},"o":{"docs":{"https://momi.cgm616.me/sections/going-to-synagogue/":{"tf":1.0}},"df":1}},"i":{"docs":{},"df":0,"n":{"docs":{},"df":0,"t":{"docs":{},"df":0,"e":{"docs":{},"df":0,"r":{"docs":{},"df":0,"m":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"a":{"docs":{},"df":0,"g":{"docs":{"https://momi.cgm616.me/sections/intermarriage/":{"tf":1.0}},"df":1}}}}}}},"v":{"docs":{},"df":0,"i":{"docs":{},"df":0,"e":{"docs":{},"df":0,"w":{"docs":{"https://momi.cgm616.me/transcripts/":{"tf":1.0}},"df":1}}}}}}}}},"j":{"docs":{},"df":0,"e":{"docs":{},"df":0,"w":{"docs":{"https://momi.cgm616.me/sections/identity/":{"tf":1.0}},"df":1,"i":{"docs":{},"df":0,"s":{"docs":{},"df":0,"h":{"docs":{"https://momi.cgm616.me/":{"tf":1.0},"https://momi.cgm616.me/sections/model-minority/":{"tf":1.0}},"df":2}}}}}},"l":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"a":{"docs":{"https://momi.cgm616.me/transcripts/lara/":{"tf":1.0}},"df":1}}}},"m":{"docs":{},"df":0,"e":{"docs":{},"df":0,"a":{"docs":{},"df":0,"n":{"docs":{"https://momi.cgm616.me/":{"tf":1.0}},"df":1}}},"i":{"docs":{},"df":0,"n":{"docs":{},"df":0,"o":{"docs":{},"df":0,"r":{"docs":{"https://momi.cgm616.me/sections/model-minority/":{"tf":1.0}},"df":1}}}},"o":{"docs":{},"df":0,"d":{"docs":{},"df":0,"e":{"docs":{},"df":0,"l":{"docs":{"https://momi.cgm616.me/sections/model-minority/":{"tf":1.0}},"df":1}}}}},"p":{"docs":{},"df":0,"r":{"docs":{},"df":0,"o":{"docs":{},"df":0,"j":{"docs":{},"df":0,"e":{"docs":{},"df":0,"c":{"docs":{},"df":0,"t":{"docs":{"https://momi.cgm616.me/about/":{"tf":1.0},"https://momi.cgm616.me/sections/":{"tf":1.0}},"df":2}}}}}}},"s":{"docs":{},"df":0,"e":{"docs":{},"df":0,"m":{"docs":{},"df":0,"i":{"docs":{},"df":0,"t":{"docs":{"https://momi.cgm616.me/sections/anti-semitism/":{"tf":1.0}},"df":1}}}},"y":{"docs":{},"df":0,"n":{"docs":{},"df":0,"a":{"docs":{},"df":0,"g":{"docs":{},"df":0,"o":{"docs":{},"df":0,"g":{"docs":{},"df":0,"u":{"docs":{"https://momi.cgm616.me/sections/going-to-synagogue/":{"tf":1.0}},"df":1}}}}}}}},"t":{"docs":{},"df":0,"r":{"docs":{},"df":0,"a":{"docs":{},"df":0,"n":{"docs":{},"df":0,"s":{"docs":{},"df":0,"c":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"p":{"docs":{},"df":0,"t":{"docs":{"https://momi.cgm616.me/transcripts/":{"tf":1.0}},"df":1}}}}}}}}}}}}},"documentStore":{"save":true,"docs":{"https://momi.cgm616.me/":{"body":"My family is not a traditional Jewish family, though we may not be atypical.\nMy dad's mother, Ellen, grew up in Connecticut going to synagogue with her Jewish mother and father.\nHer grandparents immigrated to the United States in the early 1900s.\nEventually, she had my father, Gabe.\nHe grew up going to church with his father after they separated, but always considered himself Jewish.\nAs an adult, he revisited his Jewish identity in all of its complexities.\nFinally, he married a non-Jewish woman, my mother, and had my sister, Lara, and me.\nEllen, Gabe, and Lara navigated, and continue to navigate, what it means to be an American Jew in the 20th and 21st centuries.\nI decided to ask them for their stories and see what they had to say.\nI sat down with them for about two hours each and asked them everything I had time for.\nI asked for their life stories  from childhood through school and adulthood, I wanted to learn how they became who they are today.\nI also questioned them about their Jewish identities.\nHow do they see themselves as Jewish?\nWhat does \"being Jewish\" mean?\nThen, I asked them about success, the model minority stereotype, and certain parallels between Jewish and Asian Americans.\nAfter transcribing and analyzing these interviews, I compiled what they had to say about each topic alongside my own analysis in the coming pages.\nMy family cannot and does not represent all Jews, nor do I claim they do.\nHowever, their life experiences are real and their Jewish identities are real.\nThough these interviews did not make everything clear immediately, they continue to help me understand my own Jewish identity.\nI hope they can help you do the same.\n","id":"https://momi.cgm616.me/","title":"What does it mean to be Jewish?"},"https://momi.cgm616.me/about/":{"body":"Model Minorities\nIn the fall semester of 2020, I took a class at Amherst College named Model Minorities taught by Professor Wendy Bergoffen and Professor Franklin Odo.\nThe class explored Jewish and Asian American identity, their experiences in America, and the strange stereotype of the \"model minority.\" \nA major part of the class revolved around a semester-long research project each student completed.\nThis website, and the interviews, research, and analysis it presents, are my project.\nProfessor Bergoffen and Professor Odo gave us wide latitude to decide our projects' scopes, questions, and methods, so I decided to try something new.\nI am not a social scientist; I have never used the methods that I explored for this project.\nI eventually settled on an oral history to answer my own, personal questions: what did it mean that I was Jewish?\nWho were my family members, and what are their stories?\nTruth be told, I did not know much about the lives of my family members.\nEven my sister, the person with whom I have the most in common, surprised me with what she had to say.\nIn between my questions about who these people with whom I grew up were, I asked them how they thought about Judaism and how they viewed claims about Asian and Jewish Americans that draw on the model minority stereotype.\nOther projects in the class attempted to answer related questions with a more rigorous methodology  for example, questioning a certain, well-defined group of Jewish people about their views of the model minority stereotype.\nHowever, my goal for this project was different.\nI did not attempt to provide concrete answers to difficult sociological questions.\nInstead, my goal was to explore, see what I could find, and present what interested me.\nWho are these people?\n\n  \n  A family tree. The people I interviewed are underlined in blue.\n\nThough I have said their names and their relationships to me throughout the project, I think I should clearly explain who Ellen, Gabe, and Lara are.\nLara, a 19-year-old college student at Northeastern University, is my sister.\nShe was born to Gabe and Erica in Minnesota.\nGabe is 45 years old and works for a large San Francisco software company from home in Minnesota.\nHe was born to Ellen and Reid in Connecticut.\nEllen is 70 years old and recently retired from a second career as a nurse.\nShe lives in Windham, Connecticut with her husband Kevin (also known as Gampy).\nHer parents are Alan and Sally.\nSome of her grandparents are immigrants; the others are the children of immigrants.\nMethodology\nSince my interviewees were simply family members, my project required no search for participants and no incentive for participating.\nBefore each interview, I explained to the interviewee what the goal of the project was and what they reserved the right to do after taking part.\nIn particular, participants were allowed to review the transcripts of their interview and redact any part for privacy's sake.\nAt any point in time in the future, they can request that I remove all or part of their interview from this website.\nAfter ensuring that they knew what the project was, what participation entailed, and what control they had over their information, I asked them to sign an Informed Consent Form.\nThen, I sent each interviewee my set of pre-interview questions along with a request that they spend some time thinking about the questions.\nI did not ask them to write responses.\nInstead, I designed the questions to make sure that my participants understood clearly what types of things we would talk about and to prepare them.\nThe pre-interview questions were:\n\nWhat was your experience growing up? Who were your parents, and what were they like?\nWhat do you know about your grandparents, great-grandparents, and other ancestors who were Jewish? Where did they come from? Where did they go in the United States? What challenges did they face?\nDo you consider yourself to be Jewish? In which ways? What does it mean to be Jewish? Likewise, in which ways do you or do you not consider your children and parents to be Jewish?\nHave you experienced anti-Semitism? How?\nJews are historically over-represented in certain fields and among high-achieving individuals. For example, as of 2010, Jews made up 27 percent of Nobel physics laureates, 21 percent of Ivy League student bodies, and 37 percent of Oscar-winning directors.1 Why do you think this is?\nJewish over-representation has led to claims that Jews are a sort of \"model minority\" compared with other groups that are numerical minorities of the United States, like Black Americans, that are under-represented in the same arenas. Do you think of Jews as a \"model minority\"? Why or why not?\nSince the 1960s, some commentators and sociologists have claimed that Asian Americans are a \"model minority.\" For example, Asian Americans are over-represented in medicine, where 17 percent of all active physicians identify as Asian, and in Ivy League student bodies.2 Do you think that Asian American over-representation is related to Jewish over-representation? Why would or why would you not term Asian Americans a \"model minority\"?\n\nFinally, I interviewed each participant over Zoom, a video calling software.\nEach interview lasted between an hour and a half and two hours.\nI recorded each and transcribed them with a common set of guidelines for consistency.\nFor fleshing out my methodology, I made heavy use of Donald Ritchie's Doing Oral History: A Practical Guide.3\nIRB approval\nAmherst College's Institutional Review Board (IRB) approved this project before it began.\nThe approval letter and each participant's signed Informed Consent Form are on file with me.\nAcknowledgements\nI thank my participants, Lara, Gabe, and Ellen, for their time and support while completing this project.\nI also thank my professors, Wendy Bergoffen and Franklin Odo, for their aid and ideas.\nLast, I thank Rebecca Novick, a classmate in Model Minorities, for helping me with my research.\n","id":"https://momi.cgm616.me/about/","title":"About this project"},"https://momi.cgm616.me/bibliography/":{"body":"","id":"https://momi.cgm616.me/bibliography/","title":"Bibliography"},"https://momi.cgm616.me/sections/":{"body":"Jewish identity and the lives of Jewish people are complex, so my interviewee's responses to my questions were multifaceted.\nWe can examine them from a number of different angles.\nI have given each angle its own page below, where I collected quotes from my interviewees alongside analysis of what they said.\nIn the same vein, the interviewees sometimes had similar experiences, such as going to college or starting a career.\nThough I have not collected these into their own pages, I urge you to go to the transcripts and search for keywords that you are interested in.\nAll three of these people have lived full, varied lives, and their experiences are interesting.\nFor example, what was it like for Lara to be Jewish in elementary school?\nOr what did Gabe do after graduating high school?\nTheir stories are compelling and provide insight into their conceptions of Jewish identity and their interactions with the Jewish experience.\nIf you cannot find something in my analysis below, it is most likely in the transcripts.\nThere is no right or wrong way to explore the topics. Feel free to skim a bunch or sit down with one for a longer read. When you move to a new page, your audio will continue to play without interruption.\nIf you need a reason to stay, consider the following testimonial (and try clicking the timestamp to hear Ellen say the quote):\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    What a cool thing, Coley!\n\n    \n     Ellen, (1:48:25)\n\nIf you want to learn more about my methodology and the particular people in question, check out the about page above.\n\n","id":"https://momi.cgm616.me/sections/","title":"Exploring the project"},"https://momi.cgm616.me/sections/anti-semitism/":{"body":"Unfortunately, Gabe, Lara, and Ellen all experienced anti-Semitism at some point in their lives.\nHowever, none thought that they had experienced any sort of institutional, systemic discrimination because they were Jewish.\nInstead, they pointed to individual actions, like jokes, vandalism, and stereotypical comments, that operated on a lower, more direct level.\nThese actions ranged from micro-aggressions to just plain aggressions, but none were physically violent.\nWhen Gabe was 15, working at his first job, his bosses would sometimes call him a \"dirty Jew\" after they had been drinking.\nMore recently, he pointed out some comments made by close coworkers who did not think he was Jewish that riffed on negative stereotypes about Jewish people.\nAfter he responded by saying that he was Jewish, his coworkers were embarrassed, which Gabe thought was good.\nHe then said that these instances did not \"shape\" him, and explained that he continued to work with and remain close with all of these coworkers.\nIn fact, he thought that any harm from hearing the statements was worth the opportunity to call out anti-Semitism and \"make sure that they understood that they probably shouldn't say [those things]\" to him.\nWhen asked about his experiences with structural discrimination, Gabe highlighted instead how his other identities and characteristics modified his experience of society.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:46:02)\n\nIn fact, Gabe thought that people did not often perceive him as white, which I discuss more in the section on Jewish identity.\nFor those Jews who may be perceived as non-white, or at least as Jewish, he thought challenges would be more common.\nLara had people make fun of her physical appearance, attributing certain characteristics to her Jewish heritage.\nShe also experienced comments like Gabe, usually in the context of a joke, which she explicitly named as micro-aggressions.\nOften, friends and close acquaintances made these remarks.\nOther examples of anti-Semitism that Lara talked about included acts of violence directed against Jewish people anywhere, which caused Lara to feel stressed.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    But I think you know, nationally, there's definitely some there's there's some stress, you know, if a synagogue is shot up, if there are literal Nazis. If the president endorses literal Nazis, there's definitely some stress there for my family and and my community.\n\n    \n     Lara, (1:12:02)\n\nHere, acts of violence made Lara feel worried about her own safety (\"there's definitely some stress there for my family\") and also the safety of a broader community  Jews in general  that she felt connected to.\nWhile responding to a question about anti-Semitic vandalism at her elementary and middle school in the summer of 2019, she expressed anger about what would spur someone to paint swastikas on a school.\nEllen's experience of anti-Semitism was largely similar to Lara's and Gabe's, though her experience included comments about her physical appearance that were the opposite of those directed at Lara.\nInstead of comments describing her features as Jewish, Ellen pointed out comments like \"you don't look Jewish\" as anti-Semitic in both a personal and systemic way.\nFor Ellen, these comments were anti-Semitic because they connected Judaism with physical traits and racialized Judaism.\nShe also highlighted anti-Semitic remarks made by Gabe's father and other acquaintances that played off similar stereotypes and themes as those reported by Lara and Gabe.\nThough she did not think that she experienced discrimination at school or in the workplace because of her Jewish identity, she did report that her father often said that he did not get into West Point because he was Jewish.\nShe thought it likely that her parents experienced more discrimination of that kind than she did.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    I think [my father] probably experienced [anti-Semitism] more than I did. [...] You know, and him especially in the business world. [...] I can remember you know, there was a country club in Wethersfield that that I remember my parents saying, well, not only could we not afford it, but they wouldn't let Jewish people in.\n\n    \n     Ellen, (1:25:04)\n\nFor Lara, Gabe, and Ellen, anti-Semitism reared its head as harmful statements far more than harmful actions or group discrimination.\nHowever, all three were keenly aware of the fact that anti-Semitism still existed and that Jews had suffered for many years due to anti-Semitic violence and discrimination.\n","id":"https://momi.cgm616.me/sections/anti-semitism/","title":"Anti-Semitism"},"https://momi.cgm616.me/sections/going-to-synagogue/":{"body":"All of my participants spoke about the religious quality of Judaism and Jewish identity, though each had different experiences with its religious parts.\nIn some ways, their ideas of Judaism as a religion had a lot to do with constructing an ethnic identity as a member of a group, which I discuss more in the page about Jewish identity.\nEllen was the only one of the three to grow up going to synagogue and to have a bat/bar mitzvah, though Lara did briefly attend synagogue as a child after her parents divorced.\nFor Ellen, her childhood synagogue represented community. \n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n        \n    \n    \n    \n    I loved [the synagogue]. [...] I mean, my friends were there. [...] I liked the people there. I liked I think the sense of community, is through reading through your questions and through thinking about things, I think that's what I always looked for in a in religion is a sense of community.\n\n    \n     Ellen, (0:09:00)\n\nUp until her early teenage years, Ellen attended the only synagogue in the town of Wethersfield, Connecticut.\nHer family was quite active there.\nBetween Saturday morning services, Sunday school, and after-school Hebrew school at a neighbor's house, Ellen grew up with no lack of Jewish religious education and participation.\nIn fact, she was one of the first women to have a bat mitzvah at her synagogue.\nAfterwards, however, her family switched to a \"synagogue where there were more young people\" so she would date boys who were Jewish.\nEllen hated the new synagogue and refused to go.\nIronically, it was only later in her life  after she married a non-Jewish man  that she would return to synagogue.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    So they moved to this other synagogue that was Reform, and I absolutely hated it and refused to go to it. So that was kind of it for me with synagogue until much later in my life when I was with Gampy.\n\n    \n     Ellen, (0:11:22)\n\nIn between her childhood and returning to attending a synagogue, Ellen felt little need to be a part of any organized Jewish religion.\nShe already had a community of people around her.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    And [the community of people I lived with] was kind of I guess my community. [...] I probably would never have even, at that point, thought of joining a synagogue. Yeah.\n\n    \n     Ellen, (0:35:17)\n\nWhen she did go back, however, it was again for a sense of community.\nAfter a friend passed away from cancer, Ellen attended a funeral service and missed the \"strong community support\" that she felt there.\nJudaism, however, was not an obvious choice.\nAfter she attended a Quaker meeting and checked out Unitarianism, investigating where she could find religious community, Ellen found a small, interfaith synagogue in Hebron, a nearby town.\nShe then began to bring Luke and Liz, her children with Gampy, to the synagogue.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    And I was willing to make the effort to bring Luke there and and Liz. And to get involved. And Gampy was willing to let me do it. You know, he felt like, yes, it would be really nice to give our kids something. Some faith that they can do what they want with, you know.\n\n    \n     Ellen, (0:44:59)\n\nHowever, she felt like she should not and could not bring Gabe, who was around 16 at the time.\nAt that point, she felt like he was too old: \"it wasn't like there was a Sunday school class for a 16 year old.\"\nHer relationship with Reid, Gabe's father, also made the prospect of bringing him daunting.\nSince Reid had custody of Gabe for many weekends, getting Reid to let Gabe go to synagogue on Saturdays \"just seemed impossible\" to Ellen.\nAdding more complexity was Gabe's church attendance, which made Ellen worried that bringing him to synagogue would be confusing.\nHowever, she was unsure if she made the right decision, saying, \"I don't know if that was the right thing or the wrong thing.\"\nGabe wished that he had attended synagogue with Ellen when she resumed attending.\nHe said that he regrets her decision to not bring him, though he did not blame her and understood why she made it.\nIn fact, he said that some of the reasons she did not bring him were the same as some of the reasons that he did not bring his children to synagogue.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (0:30:23)\n\nHe felt that he missed out on something core to Judaism as a kid by not attending synagogue.\nSince he was not raised Jewish, he did not learn the rituals and traditions associated with Judaism.\nHe also felt like a part of his Jewish identity was lacking since attending synagogue is \"a shared experience that most Jews have\" that he does not.\nRetrospectively, he wished that he had experienced Judaism more fully much earlier in his life.\nIn fact, Gabe explicitly compared Judaism with Christianity when talking about his regrets about attending synagogue.\nSince his mom did not practice when he was younger and his dad wanted to raise him Christian, he ended up attending a Christian church.\nThough he celebrated Jewish holidays with his mother, he attended church with his father \"twice on Sunday.\"\nHe also attended Bible summer camp.\nHowever, later in life, he felt more at home with the symbols of Judaism. \nHe felt \"very turned off by Christianity\" in part because of the space between how he saw some Christians acting and what they claimed to believe.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:14:43)\n\nJust as Ellen resumed attending synagogue as an adult, Gabe decided to attend synagogue later after he got divorced.\nHis decision stemmed partly from a desire to work out pain and sadness that he felt.\nAttending synagogue helped him figure out \"where [he] was headed\" and reflect on his life.\nGabe also said that attending synagogue was part of rationalizing and figuring out who he was.\nIn the future, he wants to go through the conversion process in order to learn more about Judaism and what it means.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:31:39)\n\nJudaism attracted Gabe in part because of how he understood the relationship between a person and God.\nDespite feeling like he needed to know more, he felt that in Judaism, \"God is in small moments\" and \"manifests in everyday life.\"\nFor Gabe, Judaism was attractive as a religion precisely because it was not easy.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:34:58)\n\nJust as Gabe did not attend synagogue as a child but did participate in Jewish holidays, Lara only went to synagogue for a short period in her childhood.\nHowever, she remembers and cherishes celebrating Passover with her extended family.\nFor Lara, the pull towards religious Judaism is its community.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    I thought it was a lot of fun. I love the stories. I love the atmosphere. I think the most alluring thing about religion to me is the community, which was always just so welcoming. And we did that and we still celebrate holidays every year with both our immediate family at times like Hanukkah and with our extended family for Passover. And that is one of my favorite times of the year.\n\n    \n     Lara, (0:07:41)\n\nRecently, Lara realized that she wanted to know more about Judaism \"in a religious sense.\"\nIn addition to wishing that she had been raised Jewish by Gabe, who in turn wished he had been raised Jewish by Ellen, Lara wished that she had sought out Judaism herself at a younger age.\nIn college, she is majoring in Jewish Studies and learning Hebrew in an attempt to \"reclaim\" some of her identity.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    I wish that I had sought out Judaism in my own Jewish identity before now. Because I once once I hit middle school, and I realized, kind of, what the situation was, there are things I could have done.\n\n    \n     Lara, (0:15:55)\n\nAll three participants said that for them, the Jewish religion was a community that they either appreciated, wanted to be a part of, or were a part of. \nAll three also varied in their own connection to Judaism over time.\nWhen faced with practical life considerations, they made decisions that altered the way they and their children related to Judaism.\n","id":"https://momi.cgm616.me/sections/going-to-synagogue/","title":"Going to synagogue"},"https://momi.cgm616.me/sections/identity/":{"body":"Two of my interviewees expressed that Jewish identity consisted of more than religion, but varied in the strength of their convictions.\nThe third, Ellen, was insistent that Judaism was solely religious, but revealed contrasting opinions later on in our interview.\nIn fact, all three described Jewish identity in an unstable manner.\nBy this, I mean that they often expressed a lack of certain knowledge, allowed for other understandings of Jewishness than their own, and seemed stuck between multiple ideas of Jewish identity.\nNote carefully that I do not mean to say that their understandings of Jewish identity were wrong or somehow bad.\nInstead, I only seek to highlight that they expressed insecurity and uncertainty about the ways Jewishness exists, following in the well-traveled path of other thinkers who have struggled to define Judaism.1\nThe most dogmatic understanding of Jewish identity was Ellen's.\nNumerous times through our interview, she said emphatically that \"Judaism is a religion.\"\nFor Ellen, Judaism is not a \"nationality\" or \"race.\"\nKey to her understanding was that there are many different Jews, and that anyone who wanted to could become Jewish.\nThis assertion perhaps harks back to her own search for religious community as an adult: she was able to choose Judaism as much as she could have chosen to be a Quaker or Unitarian Universalist.\nIn particular, she draws a distinction between the categories of 'Jewish American' and 'Asian American.'\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    I mean, Jewish is a religion. You know, it's not like if you say Asian Americans, that's different. You know, that's not a religion. Like you have you have African Jews, you have Spanish Jews, you know, you've got German Jews, you've got Austrian Jews, you've got Jews in Nigeria, you've got Jews in India.\n\n    \n     Ellen, (1:38:55)\n\nConsidering the post-World War 2 shift away from racial characterizations of Judaism, Ellen's insistence that Judaism is a religion is unsurprising.2\nHowever, modern day DNA tests throw a wrench into that conception of Judaism by claiming that somehow, our very cells are Jewish.\nEllen twice pushed back against the biological conception of Judaism found in DNA tests.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    You know, it's it's not a nationality, even though Ancestry.com [a DNA testing service] says it is, which is weird, I think.\n\n    \n     Ellen, (1:39:21)\n\nThough she said \"nationality,\" more common terms for what tests like Ancestry.com might reveal are (biologized) ethnicity, genetics, and heritage.\nWhen genetic tests reveal data like a person's percentage of \"Ashkenazi DNA,\" they traffic in imprecision around what they mean, \"sometimes conflating racial, ethnic, national, regional, or continental categories.\"3\nHowever, in her choice of words, it's possible to discern another possible cause for Ellen's uncomfortability with non-religious understandings of Judaism.\nA common anti-Semitic trope is dual loyalty: the idea that Jews are loyal to the Jewish nation, whatever that may be, rather than the nations in which they reside.\nThough genetic material cannot provide any information on nationality, particularly in racially and ethnically diverse places like the United States, Ellen's rejection of DNA tests is seemingly based on worries about what it means for Judaism to be a nationality. \nDespite her insistence that Judaism is a religion, Ellen acknowledged that there is something more to Judaism.\nIn some ways, her own identity was like that of the second generation Jews outlined by Herbert Gans, who \"could actually envisage no alternatives to being Jewish\" and whose \"Jewishness was similarly submerged and unconscious, entirely beyond the realm of choice.\"4\nAt one point, she said that she had never thought of herself as not Jewish, despite spending a long time without practicing Judaism as a religion.\nWhen asked if the fact that her parents were Jewish influenced her Jewish identity, she said that it probably had, although not from the point of view of genetics, descent, or heritage.\nInstead, she used cultural terms to describe Judaism's attractiveness.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    I mean, [Judaism is] a shared set of values and tradition that I always felt was important to keep that thread. Whatever it was.\n\n    \n     Ellen, (1:18:04)\n\nEllen's conception of a \"thread\" through time connecting her to previous Jews brings to mind ethnic characterizations rather than strictly religious ones.\nLater, when asked if Judaism is more than a religion, Ellen compared Jewish Americans to Italian Americans.\nWhile she qualified her statement by saying that most religions had cultures attached, she likened the feeling of being in a synagogue or around other Jewish people with the feeling of a Black person at a historically Black college or university.\nThese comparisons suggest that Ellen's view of Judaism as solely a religion is not necessarily absolute.\nInstead, Judaism for Ellen might include conceptions of community, social life, and culture that transcend bare, Western ideas of religion as belief.\nOn the other hand, Lara accepted the DNA test logic of Jewishness in the blood.\nIn fact, she drew a comparison between Judaism and other \"religions\" because of Judaism's ethnic characteristics.\nThough she oscillates between using the word \"nationality\" and the word \"ethnicity\" to describe the complexity she sees in Judaism, she is clear that there is more to Jewish identity than religion.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    I also think that being Jewish, there is like a certain complexity to it that there aren't that there isn't in most other religions that I know of, in that it is both a religion and and, I what is it? It's not a nationality? It's not an ethnicity? Is it an ethnicity? Yeah. Eh, I don't know! It's in my blood. (laughing) Like you take the DNA test, it tells you you're Jewish. That's not doesn't tell you you're Christian. It's like a slightly different thing. So I was (laughing) I knew I was Jewish without needing to be religiously Jewish.\n\n    \n     Lara, (0:18:57)\n\nHowever, her belief in so-called \"blood logic\" is even more clear only a few sentences later.5\nTo Lara, her Jewish identity is an \"absolute\" truth while her Jewish religiosity is less well-defined.\nShe said that since her ancestors are Jewish, she is too.\nAccording to her, she is Jewish at very least \"in the way that\" she is Scottish, and she is confident in that identity.\nIn the future, despite her many questions about Judaism as a faith, she hopes to look into what it means to be religiously Jewish.\nCuriously, Lara \"realized\" that she was Jewish in middle school when she realized that she had an identity.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    I also don't think that I knew I was Jewish in elementary school. But I knew it in middle school. (laughing) [...] in middle school, you start talking about your identity because you start to realize that you have one, which is a fun and difficult time.\n\n    \n     Lara, (0:04:30)\n\nUnlike Ellen, Lara firmly believes that Judaism is not simply a religion.\nGabe agrees with Lara, though his characterizations are somewhat less specific.\nFor Gabe, Judaism is a set of cultural practices along with ethnicity and religion.\nShared life experiences make up a large part of what it means to be Jewish for him.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:34:58)\n\nFor Gabe, being Jewish involves being part of \"one family tree.\"\nHe appreciates and enjoys how Judaism involves shared descent, though he does not exclude conversionary Jews from his definition of who is Jewish.\nIn fact, Gabe celebrates the process and ritual of being and becoming a Jew  what you learn and experience is part of Jewish identity for him.\nGabe also evoked a shared ethnic narrative, or a story that helps define a group,6 during a discussion of enrollment quotas, remarking that the \"Jewish people\"  as a sort of nation or ethnic group  had overcome adversity and discrimination before.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:56:32)\n\nLara also deployed ethnic narratives when asked why she felt proud to be Jewish, which she had mentioned.\nShe traced Jews back to the Middle Ages, most likely referencing the period of time when Ashkenazi Jews settled in Europe.\nShe then evoked the \"resiliency\" of Jews over hundreds of years of discrimination and violence and took pride in \"standing the test of time.\"\nLike Lara, Gabe said that there is a religious Judaism in which he partakes less.\nHe also said that he wished he had more access to cultural Judaism, which he identified most with Ashkenazi cultural foods.\nAnother marker of Judaism for Gabe is informal Jewish community, which neither Lara nor Ellen mentioned.\nGabe enjoyed how being Jewish shaped his life even in spaces, like the workplace, that are not specifically Jewish.\nFor instance, he spoke about having Jewish friends at work who would exchange good wishes around Jewish holidays.\nRather than Judaism-as-community in a formal sense, such as attending synagogue, Gabe appreciated informal bonds in atypical places.\nAll three participants responded that they were white when I asked, indicating that they did not think of Judaism as incompatible with whiteness.\nIn fact, Lara went so far as to say that she was the \"white version of Jew,\" both implying the existence of Jews of color and categorically separating her race  white  from Judaism.\nGabe perceived his own whiteness not as a part of his identity, but as a constructed label used by society  once again, categorically separate from how he viewed his Jewishness.\nThough he was seen as white by others, he shared experiences with anti-Semitism that occurred solely because his Judaism was not something that others could always perceive.\nIn sum, Gabe, Ellen, and Lara described Judaism not as one thing, but as a mixture of many things.\nEllen, though insistent on the religious makeup of Jewishness, described it with terms more commonly associated with ethnic belonging.\nLara clearly distinguished ethnic Judaism from religious Judaism, claiming each in different ways.\nFinally, Gabe used ethnic stories, ideas of nationhood and family, and conceptions of religious culture and tradition to describe Judaism as a non-differentiated amalgamation of religion and ethnicity.\nTheir responses map well to Emma Gonzalez-Lesser's ideas about Judaism as a combination of coordinated ideas of race, ethnicity, and religion, which she argues are not as separable as some sociologists have maintained.7\nNone of the three, despite the language they use, essentialize Judaism into any one thing.\nIt is a complex, hard-to-understand part of each of them.\n","id":"https://momi.cgm616.me/sections/identity/","title":"What is a Jew?"},"https://momi.cgm616.me/sections/intermarriage/":{"body":"Both Ellen and Gabe had children with and married people who were not Jewish, a practice termed \"intermarriage\" (or \"outmarriage\").\nGabe and Lara, accordingly, were the children of one Jew and one non-Jew.\nAll three interviewees had specific experience with some or all of intermarriage, dating non-Jewish people, and growing up with only one Jewish parent.\nIntermarriage and other romantic relationships between non-Jews and Jewish people are often regarded poorly by Jewish commentators.\nAfter a Pew Research Center survey found that rates of intermarriage were rising dramatically,1 commentators like Jack Wertheimer and Steven Cohen wrote that \"American Jews now stand on the precipice of a demographic cliff\" caused in part by intermarriage.2\nIn their analysis, intermarriage eroded organized Jewish life by producing offspring who were insufficiently connected to Judaism.\nBack in 1956, Herbert Gans similarly wrote that intermarriage was \"one of the most effective disintegrating forces in any society.\"3\nHowever, in the responses from my interviewees, children with only one Jewish parent felt a pull towards Judaism.\nBoth Gabe and Lara, though they did not attend synagogue, have bar/bat mitzvahs, or attend specifically Jewish educational services as children, desired to learn more about Judaism and keenly identified as Jewish people.\nMeanwhile, my only interviewee who did all three of those things during her childhood, Ellen, became less attached to any Jewish community for the bulk of her life, choosing instead to make community elsewhere.\nFamily attitudes towards romantic relationships with non-Jews\nPerhaps reflecting the increasing trend towards intermarriage shown in recent studies  or perhaps because both Lara and Gabe had one Jewish parent and one non-Jewish parent  only Ellen recalled her family saying anything about romantic relationships with non-Jews. When she ended up eloping with a man named Jeff, her dad threatened to disown her, at least in part because he was not Jewish.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    Well, I I lived with this guy Jeff for a while. And my father told me he was going to disown me [because] Jeff was not Jewish, and I was young. I was under 21.\n\n    \n     Ellen, (0:28:24)\n\nIn fact, Ellen's parents actually switched synagogues when she was a young teenager to help guide her towards Jewish boys.\nHowever, the switch backfired, ultimately turning Ellen off of religious Judaism as a whole until much later in her life.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    So he would not he did not want me to date people boys that weren't Jewish. That was a big deal. So they moved to this other synagogue that was reformed, and I absolutely hated it and refused to go to it. So that was kind of it for me with synagogue until much later in my life when I was with Gampy.\n\n    \n     Ellen, (0:11:08)\n\nFor Gabe, there was no family pressure towards marrying a Jewish person.\nNot only was his father not Jewish, his mother had married another non-Jewish man when Gabe was still young.\nIn fact, Gabe grew up going to Christian church with his father, a part of his life that I describe in the page about synagogue.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:14:16)\n\nLike Gabe, Lara felt no pressure from her family to only date Jewish people or to only ever marry someone who is Jewish.\nIn fact, Lara actively rejected stigmas against intermarriage, saying that it was just another way to divide society.\nShe remarked that children of a Jew and a non-Jew might even benefit from their dual heritage by having a foot in the door for learning about multiple cultures.\n\n    \n    \n    \n    \n    \n    \n    \n        \n    \n    \n    \n    \n    \n    Yeah, I don't think intermarriage is a bad thing at all. I don't I don't like that we use reasons to separate each other. [...] I think that if anything, [children of intermarriage] are gonna be able to grow up and know a lot more about a lot of stuff. So that's nothing nothing bad there.\n\n    \n     Lara, (1:25:02)\n\nIt is unsurprising that both Gabe and Lara think about intermarriage radically different from Jewish commentators who argue that certain demographic trends spell certain destruction for American Judaism.\nHowever, both of them are Jewish; both feel Jewish in multiple ways and have reached towards Judaism more as they got older.\nA non-Jewish mother\nLara was the only of my three interviewees to have a non-Jewish mother, which means that according to some interpretations of halakha, Lara is not Jewish.\nHowever, she has never felt excluded from Jewish spaces because of her non-Jewish mother.\nThough she expressed that excluding her from Judaism because of her patrilineal heritage would be \"old-fashioned,\" and said that an insistence on matrilineal descent could be harmful, she did not feel those harms herself.\nShe also recognized that the question of patrilineal descent is \"complicated\" since matrilineal descent is \"part of the religion.\"\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    [Being considered not a Jew because my mother isn't Jewish] doesn't really frustrate me. I've never had that used against me. People are most of the time, people are just happy you're there.\n\n    \n     Lara, (1:26:35)\n\nHowever, she was conscious of the difficulties that having a non-Jewish mother might complicate joining a synagogue \"fully,\" depending on the denomination. \n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    I'd have to convert because our mother isn't Jewish. [...] But there are some synagogues that don't care, but most of the traditional synagogues care about your mother's heritage, and our father is our Jewish line.\n\n    \n     Lara, (0:21:35)\n\nGabe had a non-Jewish father, and so is halakhically a Jew.\nHe expressed no feelings of exclusion from Judaism as a result of his dad's Christianity.\nRather, he felt that his connection with Judaism  both as a religion and as a culture  was looser because of his upbringing, similar to Lara's sentiment that she \"could have been going to synagogue this entire time with zero issues.\"\n","id":"https://momi.cgm616.me/sections/intermarriage/","title":"Intermarriage"},"https://momi.cgm616.me/sections/model-minority/":{"body":"The term 'model minority' refers to a numerical minority in America that, in comparison with other groups in the numerical minority, seems to do better.\nWhen people use the term, they take economic characteristics, like average incomes, average wealth, and unemployment, and paint a picture of a group that can serve as a model for other, supposedly less successful groups.\nFor example, some call both Asian Americans and Jewish Americans model minorities because of certain \"successes\" that are usually attributable to culture, group characteristics, or, in extreme cases, biological factors.\nCentral to the idea of the model minority is a characterization of white society as the norm.\nPeople who are not (Christian and) white can either do worse than white people, approach white success, or exceed white success in the model minority paradigm.\nOn face value, the model minority stereotype seems beneficial at best and innocuous at worst.\nWhat is so problematic about saying that a group's culture makes them stand out among minorities?\nWhen asked if they thought that \"model minority\" was an apt term to describe the real phenomenon of Jewish over-representation in various fields, all of my interviewees identified conceptual weaknesses within the idea and spoke out against its inherent logic of comparison.\nAt the same time, both Ellen and Gabe, when pushed to explain over-representation, fell back on theories of cultural factors, such as a Jewish focus on study, for explanation.\nWhen asked about the model minority stereotype, Lara immediately thought of colorism, which is discrimination on the basis of skin color tied to racial groups.\nLara identified how calling Jews a model minority was a way of defining their proximity to whiteness.\nShe said that she had heard the phrase used in academia and in the news, particularly with respect to Asian Americans and Jewish Americans, but felt that it was used as an unfair comparison used to maintain the status quo of white supremacy by blaming marginalized groups for their own oppression.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    If Jewish people are model minorities, it's only because that phrase was coined to put down other groups of people and not actually give them the support and and reparations or recognition or help that they need as a as a community that's been, you know, destroyed over and over again.\n\n    \n     Lara, (1:33:31)\n\nKey to her understanding was the explicit and implicit narrative she heard in the usage of \"model minority.\"\nShe said that she often heard phrases like \"why can't you [Black Americans] be more like them [Jewish and Asian Americans]?\"\nUltimately, when it came to questions of scarce resources (such as spots in Ivy League student bodies), Lara argued that quotas that restrict attendance from marginalized groups were harmful, but quotas that ensure white people do not take up the spots needed for marginalized students were acceptable.\nMost interestingly, she said that she did not consider herself to be a minority because of her privilege.\nHere, she employed a working definition of minority to mean \"marginalized group.\"\nDespite the historic and current discrimination against Jewish people, she viewed her own privilege as a white and financially stable as overriding.\nIn order to explain Jewish over-representation in certain fields, Lara relied on knowledge she had gained about Jewish professions in Europe from a history class.\nMuch like David Hollinger, she relied on the characteristics of Jews in the Diaspora to explain success rather than culture, such the tendency (often enforced by law) of Jews to work in trades and with money rather than tending land for food.1\nOne could call this the \"right place, right time\" phenomenon.\nGabe similarly criticized the model minority concept as an attempt to \"categorize and separate\" Jews from other marginalized groups.\nHe drew a distinction between the degree and kind of discrimination experienced by American Jews and Black Americans.\nHe also said that Jewish people have had a longer time to overcome obstacles caused by white supremacy  thousands of years compared with one hundred and fifty for Black Americans.\nHowever, at the same time, Gabe fell back on cultural explanations for disparate success.\nWhile he was careful to say that other groups did not lack cultural qualities like perseverance, he did point to Jewish resiliency as a reason for our success.\nWhile he claimed Jewish cultural qualities helped Jews overcome adversity, a lack of those cultural qualities was not to blame for disparities and discrimination suffered by other marginalized groups.\nGabe's ideas about Jewish resiliency are tightly tied up in his ethnic narrative of the Jewish people.\nGabe also found cultural factors useful while explaining Asian American over-representation, focusing on \"Eastern culture\" and its supposed emphasis on communitarianism rather than individualism.\nHere, he used essentialized culture concepts that Chih-Chieh Chou tells us is simply another manifestation of race.2\nHowever, he again took care to say that lacking proper cultural qualities is not why other groups are unable to, in his words, bypass impediments like structural discrimination.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    This transcript has been redacted.\n    \n     Gabe, (1:59:50)\n\nGabe expressed anxiety about the questions at hand, aware that he did not have perfect answers to my questions about possible explanations for over-representation and certain types of success.\nHe oscillated between contrasting ideas, building what I call a \"thick\" conception of discrimination and success.\nNo one reason caused disparate outcomes; instead, a combination of many things, both societal and individual, led to relative over-representation and under-representation.\nEllen was the only one of my participants to say explicitly that she had not heard of the model minority stereotype before our interview.\nHowever, once she understood it, she disagreed with the idea that someone's Judaism had a bearing on their success since \"Judaism is a religion.\"\nHowever, she also said later that in Jewish culture, there was a focus on education that might cause disparities.\nShe also attributed this emphasis to Asian cultures when asked about Asian American over-representation.\nLike Gabe, she used ideas of cultural difference to help explain over-representation, accepting, to some extent, the model minority stereotype.\nHowever, she was unsure of her answers and focused on other possible explanations, such as socio-economic class and related advantages, that might absolve her of relying on culture.\nIn other words, culture difference was an explanation of last resort, one that she was suggesting rather than claiming to be true.\n\n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    \n    [Q: Do you think that Jewish over-representation and Asian American over-representation might be caused by the same thing?]\n(long pause) I think, in the Asian culture, from what I know about it, there's a big push on education. And I think in the Jewish culture there's a big push on education. And on family. So I think that those could possibly be could lead to to some of that. But, you know, other than that, I mean, what I don't I can't imagine what other reason there would be, you know?\n\n    \n     Ellen, (1:44:29)\n\nThe questions that I asked my participants were perhaps not fair, since I asked them explicitly to tell me why they thought certain hard-to-explain facts were true while at the same time implicitly requiring them to avoid the easiest explanations because they were racist.\nThis implicit requirement, which stems from a desire to be anti-racist and to perform anti-racism, is not a bad thing.\nIt is good that my participants paused, contradicted themselves, and offered suggestions rather than truths: none are sociologists, and none claimed to know enough to explain these phenomena.\nIn fact, many of them indicated that they were not sure and did not know enough to answer well.\nAll of this is to say that their answers should not be seen as despicable or as proof that they are racist, regardless of the problems in some of what they said.\nInstead, their answers can help us understand how they rationalize these problems in the absence of empirical, academic knowledge.\nTheir hesitation and uncomfortability suggests that they were unsatisfied with the answers they suggested; their willingness to attempt to answer suggests they are willing to learn, understand, and conceptualize the type of anti-racism we need going forward.\n","id":"https://momi.cgm616.me/sections/model-minority/","title":"Jewish Americans as a model minority"},"https://momi.cgm616.me/transcripts/":{"body":"Each transcript is on its own page, which you can access through the navigation bar or the links below.\nIn the transcripts, click the timestamp to immediately jump to that part of the audio.\n\nLara's interview\nGabe's interview\nEllen's interview\n\n","id":"https://momi.cgm616.me/transcripts/","title":"Interview transcripts"},"https://momi.cgm616.me/transcripts/ellen/":{"body":"","id":"https://momi.cgm616.me/transcripts/ellen/","title":"Ellen"},"https://momi.cgm616.me/transcripts/gabe/":{"body":"","id":"https://momi.cgm616.me/transcripts/gabe/","title":"Gabe"},"https://momi.cgm616.me/transcripts/lara/":{"body":"","id":"https://momi.cgm616.me/transcripts/lara/","title":"Lara"}},"docInfo":{"https://momi.cgm616.me/":{"body":138,"title":2},"https://momi.cgm616.me/about/":{"body":516,"title":1},"https://momi.cgm616.me/bibliography/":{"body":0,"title":1},"https://momi.cgm616.me/sections/":{"body":126,"title":2},"https://momi.cgm616.me/sections/anti-semitism/":{"body":379,"title":2},"https://momi.cgm616.me/sections/going-to-synagogue/":{"body":659,"title":2},"https://momi.cgm616.me/sections/identity/":{"body":925,"title":1},"https://momi.cgm616.me/sections/intermarriage/":{"body":519,"title":1},"https://momi.cgm616.me/sections/model-minority/":{"body":726,"title":4},"https://momi.cgm616.me/transcripts/":{"body":22,"title":2},"https://momi.cgm616.me/transcripts/ellen/":{"body":0,"title":1},"https://momi.cgm616.me/transcripts/gabe/":{"body":0,"title":1},"https://momi.cgm616.me/transcripts/lara/":{"body":0,"title":1}},"length":13},"lang":"English"};